package com.etrack.myapplication.model.inputService;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;/** * Created by Hussain on 28-03-2018. */public class GetBranchs {    @SerializedName("objbranch")    @Expose    private Objbranch objbranch;    public Objbranch getObjbranch() {        return objbranch;    }    public void setObjbranch(Objbranch objbranch) {        this.objbranch = objbranch;    }    public class Objbranch {        @SerializedName("branch_id")        @Expose        private String branchId;        @SerializedName("company_id")        @Expose        private String companyId;        public String getBranchId() {            return branchId;        }        public void setBranchId(String branchId) {            this.branchId = branchId;        }        public String getCompanyId() {            return companyId;        }        public void setCompanyId(String companyId) {            this.companyId = companyId;        }    }}